def calculate_fibonacci_sequence(n, m=None):
    """"""
    if n <= 0:
        return []
    if n == 1:
        return [0]
    if n == 2:
        return [0, 1]
    sequence = [0, 1]
    (a, b) = (0, 1)
    for _ in range(2, n):
        (a, b) = (b, a + b)
        if m is not None:
            (a, b) = (b % m, (a + b) % m)
        sequence.append(b)
    return sequence
